import React from 'react';

import style from './List.module.css';

const List = () => {
    return(
        
        <section>
            <h1>Homes around the world</h1>
            <div className= {style.mainSection}></div>
        </section>
    )
};

export default List;


const PRODOTTI = [
    {
      categoria: 'Attrezzatura Sportiva',
      prezzo: '$49.99',
      disponibile: true,
      nome: 'Palla da calcio',
    },
    {
      categoria: 'Attrezzatura Sportiva',
      prezzo: '$9.99',
      disponibile: true,
      nome: 'Palla da tennis',
    },
    {
      categoria: 'Attrezzatura Sportiva',
      prezzo: '$29.99',
      disponibile: false,
      nome: 'Palla da canestro',
    },
    {
      categoria: 'Elettronica',
      prezzo: '$99.99',
      disponibile: true,
      nome: 'iPod Touch',
    },
    {
      categoria: 'Elettronica',
      prezzo: '$399.99',
      disponibile: false,
      nome: 'iPhone 5',
    },
    {
      categoria: 'Elettronica',
      prezzo: '$199.99',
      disponibile: true,
      nome: 'Nexus 7',
    },
  ];
